import React from "react";

import classes from "./VideoParameterInfo.module.scss";

const videoparameterinfo = (props) => {
  let switched = props.switched;
  let display = {};

  if (switched) {
    display = props.display;
  }

  console.log("current: ", props.currentActivity);
  console.log("display: ", display);
  console.log("switched", switched);
  console.log("Current resolution:" + props.currentActivity);

  return (
    <div className={classes.videoParameterInfo}>
      <div className={classes.message}>
        <h2 className={classes.title}>Define video parameters</h2>
        <p className={classes.videoParameterMessage}>
          Add video parameters here
        </p>
      </div>
      <div className={classes.humanNum}>
        <h2 className={classes.humanNumTitle}>Human tracking per video</h2>
        <p className={classes.humanNumMessage}>
          Enter human tracking per video here
        </p>
        <div className={classes.humanNumQuery}>
          <input
            className={classes.humanNumInput}
            name="numPeople"
            onChange={props.onChange}
            value={display.fromFt}
          />
          <h3 className={classes.people}>people</h3>
        </div>
      </div>
      <div className={classes.videoDuration}>
        <h2 className={classes.videoDurationTitle}>Range of video duration</h2>
        <p className={classes.videoDurationMessage}>
          Enter range of video duration here
        </p>
        <label className={classes.label}>From</label>
        <input
          className={classes.heightFromFt}
          name="fromMin"
          onChange={props.onChange}
          value={display.fromMin}
        />
        <label className={classes.label}>To</label>
        <input
          className={classes.heightFromFt}
          name="toMin"
          onChange={props.onChange}
          value={display.toMin}
        />
      </div>
      <div className={classes.videoResolution}>
        <h2 className={classes.videoResolutionTitle}>Video Resolution</h2>
        <p className={classes.videoResolutionMessage}>
          Select video resolution here
        </p>
        <div className={classes.resolutionOptions}>
          <input
            type="radio"
            id="1080p"
            name="resolution"
            value="1080p60"
            // checked={display.resolution === "1080p60"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} htmlFor="resolution">
            1080p60
          </label>
          <br />
          <input
            type="radio"
            id="720p"
            name="resolution"
            value="720p60"
            checked={display.resolution === "720p60"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} for="720p60">
            720p60
          </label>
          <br />
          <input
            type="radio"
            id="480p"
            name="resolution"
            value="480p"
            checked={display.resolution === "480p"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} for="480p">
            480p
          </label>
          <br />
          <input
            type="radio"
            id="360p"
            name="resolution"
            value="360p"
            checked={display.resolution === "360p"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} for="360p">
            360p
          </label>
          <br />
          <input
            type="radio"
            id="240p"
            name="resolution"
            value="240p"
            checked={display.resolution === "240p"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} for="240p">
            240p
          </label>
          <br />
          <input
            type="radio"
            id="144p"
            name="resolution"
            value="144p"
            checked={display.resolution === "144p"}
            onChange={props.onChange}
            className={classes.radioButton}
          />
          <label className={classes.label} for="144p">
            144p
          </label>
        </div>
      </div>
      <div className={classes.videoNum}>
        <h2 className={classes.videoNumTitle}>
          Number of videos for IMU data processing
        </h2>
        <p className={classes.videoNumMessage}>
          Enter number of videos to process here
        </p>
        <input
          className={classes.heightFromFt}
          name="numVideo"
          onChange={props.onChange}
          value={display.fromMin}
        />
      </div>
    </div>
  );
};
export default videoparameterinfo;
